import React, { Component } from 'react';
import {Redirect} from 'react-router-dom';

class Logout extends Component {

    componentDidMount(){
        localStorage.clear()
        console.log(this.props.history.replace("/login"))
    }
    render() {

       
        return (
            <div>
                 {
                     console.log()
                 }
                <Redirect to="./login" />
            </div>
        );
    }
}

export default Logout;
